he Lasagna alla Bolognese with spinach noodle, besciamella, and ragù bolognese, and parmigiana. The Lasagna Napoletana with durum noodle, ricotta, ragù Napoletana, sausage, egg, tiny little meatballs, provola (I had provolone), and pecorino. Everything homemade, including the noodles. I used the method where the noodles overstretch the sides of the pan and are later folded down over top to enclose the lasagna. With great daring, I decided I could make these lasagne in the same pan. And it worked😃

—

Really interesting to compare these two and think about the origins of the prototypical Italian-American lasagna. Many people categorize Italian-American dishes as something altogether different from Italian food. Of course there has been innovation and even invention, and, to a large degree, Italian-American cuisine merits this distinction. But it does not deserve to be dismissed as entirely inauthentic or lesser. Many dishes have recognizable predecessors in Italy. Sometimes the name changes, ingredients are substituted, and the cultural role of the food shifts. One look at the Lasagna Napoletana, and I think you’ll agree this could be the case. Lasagna Napoletana was usually enjoyed during Carnevale with its somewhat expensive and symbolic ingredients. In America, with the greater availability of meat and the interest of returning troops, it popularity took off. It’s pretty much filled with the remnants of Sunday dinner!👌";}i:69;a:1:{s:14:"comments_count";i:4;}i:70;a:1:{s:11:"likes_count";i:16;}i:71;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvMJYCFRgq";}i:72;a:1:{s:5:"image";s:247:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/118818252_363519364665901_51746857802017877_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=101&_nc_ohc=crSkxx9kYFIAX-qV-sF&oh=e3e5e5461a3fb0813f4c7f056bd8ec1c&oe=5F7AF3C4";}i:73;a:1:{s:4:"type";s:7:"sidecar";}i:74;a:1:{s:8:"owner_id";i:27675083372;}i:75;a:1:{s:14:"owner_username";s:0:"";}i:76;a:1:{s:14:"owner_fullname";s:0:"";}i:77;a:1:{s:9:"owner_pic";s:0:"";}i:78;a:1:{s:2:"id";s:19:"2391181452547250991";}i:79;a:1:{s:10:"short_code";s:11:"CEvLtywlNsv";}i:80;a:1:{s:12:"created_time";i:1599271063;}i:81;a:1:{s:7:"caption";s:220:"Quando ti chiedono un vodka lemon bello...
